import {setRegisterForm} from "../../store/register-form/actions";

class RegisterFormContainer extends Component{
    createNewTodo = event => {
        console.log(event);
        this.props.setRegisterForm(event);
        console.log(this.props.label)
    };

    onSubmitTodo = () => {

    };

    render() {
        return <RegisterForm
            onChangeForm={this.createNewTodo}
            onSubmitTodo={this.onSubmitTodo}
            label={this.props.label}
        />;
    }
}

